import React from 'react'
import './Register.css';




function Register() {
    return (
        <div className="Register__bg">
            <h1>Register</h1>
            <form className="Register__form">
                {/* <label className="Firstname" action="" >First name</label> */}
                <input className="Register__firstname" type="text" placeholder="First name"/> 
                {/* <label className="Lastname">Last name</label> */}
                <input className="Register__lastname" type="text" placeholder="Last name" /> <br/>
                {/* <label>Email</label> */}
                <input className="Register__email" type="text" placeholder="example@email.com" />

            </form>
           
        </div>
    )
}

export default Register
